import './Chat.css';
import React, { Component } from 'react';

export default class Create extends Component {
    render() {
        return (
            <div class="frame">
                <div class="option">
                    <div class="opt-1">
                        <p>room name</p>
                        <input type="text" name="room_name" />       
                    </div>
                    <div class="opt-2">
                        <p>room password</p>
                        <input type="text" name="room_password" />
                    </div>
                </div>

                <div class="back">
                    <button class="go-back">
                        Create
                    </button>
                </div>
            </div>


        );
    }
}
